import React, { useEffect } from "react";
import DG from "2gis-maps";
import { useState } from "react";
const sock = new WebSocket("ws://204.12.199.7:9999/ws");

export default function Test() {
  
  const [location, setLocation] = useState({
    latitude: 41.313723,
    longitude:  69.282787
  });
  
  sock.onopen = function (event) {
    console.log("connection successful");
    sock.send("get data");
  };

  sock.onmessage = function (event) {
    let jsonData=JSON.parse(event.data);
    let newObj={
      latitude:Number(jsonData[0].Latitude),
      longitude:Number(jsonData[0].Longitude),
    };
    setLocation(newObj);
    console.log(newObj);
  };

  sock.onclose = function (event) {
    console.log(event.data);
    console.log("connection closed");
  };

  useEffect(()=>{

    let map;
    map=DG.map('map-container',{
      center:[location.latitude, location.longitude],
      zoom:15
    });
    
    
    // Set max zoom level
    map.setMinZoom(3);
  },[])
  
      const icon = DG.icon({
        iconUrl: "https://freepngimg.com/thumb/car/75694-bird's-eye-car-top-view,plan-view-icon.png",
        iconSize:[35,30]
      });
  DG.marker([location.latitude, location.longitude],{icon:icon}).addTo(map).bindPopup('<h4>80-q-607-pa</h4>')

  return (
    <div id="map-container" style={{width:'100%',height:'100vh'}}>

    </div>
  );
}
